import React from "react";

export const Footer = () => {
  return (
    <>
      <div className="h-36 bg-sky-50 w-full relative flex justify-center items-center">
        <div className="w-4/5 mx-auto bg-sky-700 text-white h-44 absolute top-16 rounded-xl shadow-lg  flex justify-around items-center">
          <span className="font-titleFont text-4xl font-bold ">
            Have feedback about the website?
          </span>
          <span className="font-bodyFont text-xl font-medium">
            Interested in working together? We should queue up a time to chat.
          </span>
          <button className="bg-transparent border-2 rounded-full whitespace-nowrap px-6 py-4 text-2xl font-titleFont font-bold">
            Let's do this
          </button>
        </div>
      </div>
      <div className="h-96 bg-sky-500 w-full"></div>
    </>
  );
};
